DROP TABLE IF EXISTS `tank_mixes`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `tank_mixes` (
  `id` int NOT NULL AUTO_INCREMENT,
  `unique_code` varchar(50) NOT NULL,
  `tank_id` int NOT NULL,
  `creation_date` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `status` enum('ACTIVE','ARCHIVED') NOT NULL,
  `process_status` varchar(50) NOT NULL COMMENT 'Jawny status etapu przetwarzania mieszaniny',
  `main_composition` json DEFAULT NULL COMMENT 'Sownik gwnych skadnikw z procentami, np. {"T10": 99.0}',
  `wydmuch_percentage` decimal(5,2) NOT NULL,
  `filter_remains_percentage` decimal(5,2) NOT NULL,
  `filtration_cycles_count` int NOT NULL,
  `wydmuch_cycles_count` int NOT NULL,
  `bleaching_earth_bags_total` int NOT NULL,
  `whiteboard_id` varchar(10) DEFAULT NULL COMMENT 'Identyfikator z whiteboardu, np. (A), (B)',
  `is_wydmuch_mix` tinyint(1) NOT NULL COMMENT 'Oznacza, czy ta mieszanina skada si wycznie z wydmuchw.',
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_code` (`unique_code`),
  KEY `tank_id` (`tank_id`),
  CONSTRAINT `tank_mixes_ibfk_1` FOREIGN KEY (`tank_id`) REFERENCES `sprzet` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=120 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
